import Card from "./Card";
import forest from './images/forest.jpg';
import hare from './images/hare.jpg';
import dinning from './images/dinning-and-kitchen.jpg';

const objects = [
  {
    picture: forest,
    rating: 5.8,
    reviewCount: 6,
    country: 'USA',
    title: 'Life lessons with Katie Zaferes'
  },
  {
    picture: hare,
    rating: 4.5,
    reviewCount: 4,
    country: 'England',
    title: 'On our way to success'
  },
  {
    picture: dinning,
    rating: 7.9,
    reviewCount: 9,
    country: 'Turkey',
    title: 'The very final lap'
  }
];

const object = objects.map(obj => <Card picture={ obj.picture } rating={ obj.rating } reviewCount={ obj.reviewCount } country={ obj.country } title={ obj.title }/>)
console.log(objects);

export default function Footer() {
  return (
    objects
  );
};
